import ReactPlayer from 'react-player';

const VideoDsply = () => {
  return (
    <div
      className='iframe-container'
      style={{ width: '800px', height: '400px' }}
    >
      <ReactPlayer url='https://youtu.be/RPPR5Yqzapo' alt='Heifetz playing' />
    </div>
  );
};

export default VideoDsply;
